#[inline]
pub const fn between_fill(a: Square, b: Square) -> u64 {
    let line_mask = line_fill(a, b);
    // If aligned
    if line_mask != 0 {
        let b = (line_mask & ((ALL << a.offset() as u64) ^ (ALL << b.offset() as u64)));
        b & (b - 1)
    } else {
        0
    }
}
#[inline]
pub const fn aligned(a: Square, b: Square, c: Square) -> bool {
    // If the line between a and b intersects c
    line_fill(a, b) & c.mask() > 0
}
#[inline]
#[cfg(not(feature = "low_memory"))]
pub const fn line_fill(a: Square, b: Square) -> u64 {
    LINE_TABLE[a.offset() as usize][b.offset() as usize]
}
#[inline]
#[cfg(feature = "low_memory")]
pub fn line_fill(a: Square, b: Square) -> u64 {
    line_bb(a, b)
}

